import React from 'react';
import Elder from '../Images/Elder.jpg';
import "../Css/Design.css"


const images={
  Elder
};

class Designs extends React.Component {
  renderLng = () => (
<div className="extra">
  <div class="gallery">
    <img src={Elder} alt="Elder"/>
  </div>
  <div class="gallery">
    <img src={Elder} alt="Elder" />

  </div>
</div>

  )
  render() {
    return (
      <div>
        <div>
        <img src={images[this.props.src]}></img>

        </div>
      </div>
    )
  }
}
export default Designs;
